import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../components/Navbar";

import ModularKitchen from "../images/Services/modularkitchen.jpg";
import FalseCeiling from "../images/Services/falseCeiling.jpg";
import TVUnit from "../images/Services/Tvunits.jpg";
import Wardrobe from "../images/Services/wardrobs.jpg";
import OfficeSpace from "../images/Services/officespaces.jpg";
import Bedroom from "../images/Services/bedroom.jpg";
import ExternalArchitecture from "../images/Services/ExternalArc.jpg";

const services = [
  { title: "Residential Construction", image: Bedroom },
  { title: "Commercial Construction", image: OfficeSpace },
  { title: "Industrial Projects", image: ExternalArchitecture },
  { title: "Renovation & Remodeling", image: Wardrobe },
  { title: "Project Management", image: TVUnit },
  { title: "Modular Kitchen", image: ModularKitchen },
  { title: "False Ceiling", image: FalseCeiling },
  { title: "TV Units", image: TVUnit },
  { title: "Wardrobes", image: Wardrobe },
  { title: "Office Spaces", image: OfficeSpace },
  { title: "Bedrooms", image: Bedroom },
  { title: "External Architecture", image: ExternalArchitecture },
];

function Navbar() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [servicesOpen, setServicesOpen] = useState(false);

  const handleMenuToggle = () => setMenuOpen(!menuOpen);

  return (
    <nav className="custom-navbar">
      <div className="nav-container">
        <div className="brand">Gajulapalli Infra</div>

        {/* Desktop Nav */}
        <div className="nav-links">
          <Link to="/" className="nav-item">Home</Link>
          <Link to="/about" className="nav-item">About</Link>

          <div
            className="nav-item services-dropdown-parent"
            onMouseEnter={() => setServicesOpen(true)}
            onMouseLeave={() => setServicesOpen(false)}
          >
            <span className="nav-item">Services â–¾</span>
            {servicesOpen && (
              <div className="services-dropdown-menu">
                {services.map((service, idx) => {
                  const anchor = service.title.toLowerCase().replace(/\s+/g, "-");
                  return (
                    <a
                      key={idx}
                      href={`/services#${anchor}`}
                      className="dropdown-link"
                      onClick={() => setServicesOpen(false)}
                    >
                      {service.title}
                    </a>
                  );
                })}
              </div>
            )}
          </div>

          <Link to="/projects" className="nav-item">Projects</Link>
          <Link to="/contact" className="nav-item">Contact</Link>
        </div>

        {/* Hamburger */}
        <button className="hamburger" onClick={handleMenuToggle}>
          <svg viewBox="0 0 24 24" stroke="currentColor" fill="none" strokeWidth="2" className="hamburger-icon">
            <path d="M4 6h16M4 12h16M4 18h16" />
          </svg>
        </button>
      </div>

      {/* Mobile Menu */}
      {menuOpen && (
        <div className="mobile-menu">
          <Link to="/" className="mobile-item" onClick={() => setMenuOpen(false)}>Home</Link>
          <Link to="/about" className="mobile-item" onClick={() => setMenuOpen(false)}>About</Link>
          <Link to="/services" className="mobile-item" onClick={() => setMenuOpen(false)}>Services</Link>
          <Link to="/projects" className="mobile-item" onClick={() => setMenuOpen(false)}>Projects</Link>
          <Link to="/contact" className="mobile-item" onClick={() => setMenuOpen(false)}>Contact</Link>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
